import React, { useState } from 'react';
import { TabMenu } from 'primereact/tabmenu';
import Branch from './Branch';
import Brand from './Brand';
import Category from './Category';
import Department from './Department';

const links = [
    { label: 'Branch', icon: 'pi pi-fw pi-file', component: <Branch /> },
    { label: 'Brand', component: <Brand /> },
    { label: 'Category', component: <Category /> },
    { label: 'Department', component:<Department/> },
    { label: 'DeviceStatus', href: '/DeviceStatus' },
];



function Menu() {
    const [activeTab, setActiveTab] = useState(0);
    return (
        <div>
            <TabMenu
                model={links}
                activeIndex={activeTab}
                onTabChange={(e) => setActiveTab(e.index)}
                className="w-full"
            />
            <div className="p-4">{links[activeTab].component}</div>
        </div>
    );
}

export default Menu;
